import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Bienvenido a QuickReserve</h1>
        <p>Tu sistema de reservas de citas médicas</p>
        <button onClick={() => alert('Aquí irá el acceso al sistema')}>Iniciar</button>
    </div>
  );
}

export default App;
